from typing import Dict, Any

def merge_dicts(*dicts: Dict[str, Any]) -> Dict[str, Any]:
    """
    Merge multiple dictionaries into one.

    Later dictionaries override earlier ones on key conflicts.
    Handles None values gracefully by skipping None dictionaries.

    Args:
        *dicts: Variable number of dictionaries to merge

    Returns:
        A new dictionary with all merged key-value pairs

    Raises:
        TypeError: If any argument is not a dictionary or None

    Example:
        >>> merge_dicts({"a": 1}, {"b": 2})
        {'a': 1, 'b': 2}
        >>> merge_dicts({"a": 1}, {"a": 2})
        {'a': 2}
    """
    result: Dict[str, Any] = {}

    for i, d in enumerate(dicts):
        if d is None:
            continue

        if not isinstance(d, dict):
            raise TypeError(
                f"Argument {i} must be a dictionary or None, "
                f"got {type(d).__name__}"
            )

        result.update(d)

    return result


# Test cases
if __name__ == "__main__":
    # Basic merge
    assert merge_dicts({"a": 1}, {"b": 2}) == {"a": 1, "b": 2}

    # Override behavior
    assert merge_dicts({"a": 1}, {"a": 2}) == {"a": 2}

    # Multiple dicts
    assert merge_dicts({"a": 1}, {"b": 2}, {"c": 3}) == {"a": 1, "b": 2, "c": 3}

    # Handle None values
    assert merge_dicts(None, {"a": 1}) == {"a": 1}
    assert merge_dicts({"a": 1}, None) == {"a": 1}
    assert merge_dicts(None, None, {"a": 1}) == {"a": 1}

    # Empty dicts
    assert merge_dicts({}) == {}
    assert merge_dicts({}, {}) == {}
    assert merge_dicts({"a": 1}, {}) == {"a": 1}

    # Complex values
    assert merge_dicts({"a": [1, 2]}, {"b": {"c": 3}}) == {"a": [1, 2], "b": {"c": 3}}

    # Chained overrides
    assert merge_dicts({"a": 1, "b": 2}, {"a": 3, "c": 4}, {"a": 5}) == {"a": 5, "b": 2, "c": 4}

    # No arguments
    assert merge_dicts() == {}

    # Error handling - invalid type
    try:
        merge_dicts({"a": 1}, "invalid")
        assert False, "Should have raised TypeError"
    except TypeError as e:
        assert "must be a dictionary" in str(e)

    # Error handling - list argument
    try:
        merge_dicts([1, 2, 3])
        assert False, "Should have raised TypeError"
    except TypeError as e:
        assert "must be a dictionary" in str(e)

